import React from 'react';
import './buttontext.css'; 

const Buttontext = ({ onClick = () => {}, label = "Buttontext" }) => {
  return (
    <button className="textbutton" onClick={onClick}>
      {label}
    </button>
  );
};

export default Buttontext;
